import React from 'react';
import Navbar from './Navbar';
import './Blog.css';
import { Link } from 'react-router-dom';

function Blog() {
  const blogs = [
    {
      id: 1,
      title: 'Andhra Pradesh',
      image: '/and.jpeg',
      shape: 'square',
    },
    {
      id: 2,
      title: 'Arunachal Pradesh',
      image: '/aru.jpeg',
      shape: 'square',
    },
    {
      id: 4,
      title: 'Goa',
      image: '/goa.jpeg',
      shape: 'square',
    },
    {
      id: 5,
      title: 'Assam',
      image: '/assam.jpg',
      shape: 'square',
    },
    {
      id: 3,
      title: 'Haryana',
      image: '/har.jpg',
      shape: 'square',
    },
    {
      id: 6,
      title: 'Gujarat',
      image: '/gujarat.jpeg',
      shape: 'square',
    },
  ];

  return (
    <div>
      <Navbar />
      <div className="blog-container">
        {blogs.map((blog) => (
          <div key={blog.id} className={`blog ${blog.shape}`}>
            <h2>
              <Link to={`/blogs/${blog.title}`}>{blog.title}</Link>
            </h2>
            <div className="image-container">
              <img src={blog.image} alt={blog.title} />
            </div>
            <p>{blog.content}</p>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Blog;
